import Layout from "../components/Layout";
import "../public/css/styles.css";

const Index = () => (
  <Layout>
    <div className="intro">
      <div className="introduction">
        <h1>
          {" "}
          Hello, there
          <span style={{ fontSize: "large", fontFamily: "Nixie one, cursive" }}>
            {" "}
            My name is{" "}
          </span>
          <span style="font-size: 50px;"> Pranesh Shrestha. </span>
        </h1>
        <p style="font-family: 'Nixie one', cursive;">
          {" "}
          I am currently Computer Engineering Student. Welcome to my Portfolio
          Website.
        </p>
        <div className="resume">
          <a href="/resume">
            <button className="resumebtn">Resume </button>
          </a>
        </div>
      </div>
    </div>
  </Layout>
);

export default Index;
